import Projects from "../components/Projects"

const renderProject = () => {
  for (let i = 0; i < 3; i++) {
    const element = projectsList[i];
    return element;
  }
}

const projectsPI = [
  renderProject(),
  { name: 'Ver +', describe: 'Conheça alguns dos principais projetos já concluídos', link: '/portfolio' }
];

const projectsList = [
  {
    name: 'MongoDB Commerce',
    describe: 'Querys para buscar dados em um banco de dados NoSQL - MongoDb',
    href: 'https://github.com/rodriguestg/gabriel-rodrigues-mongodb-commerce',
    link: '/MongoDB',
    demo: {
      img: '',
      video: '',
    }
  },
  {
    name: 'Trybe Futebol Clube! [soccer]',
    describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL',
    href: 'https://github.com/rodriguestg/gabriel-rodrigues-mongodb-commerce',
    link: '/TFC',
    demo: {
      img: '',
      video: '',
    }
  },
  {
    name: 'MongoDB',
    describe: 'Querys para buscar dados em um banco de dados NoSQL - MongoDb',
    href: 'https://github.com/rodriguestg/gabriel-rodrigues-mongodb-commerce',
    link: '/MongoDB',
    demo: {
      img: '',
      video: '',
    }
  },
  { name: '', describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL', link: '/tfc' },
  { name: '', describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL', link: '/tfc' },
];

const listRouteProjects = [
  { path: "mongodb", elem: <Projects project={ projectsList } /> }
]

const techs = ['JavaScript', 'TypeScript', 'React', 'Node.Js', 'MySQL', 'Jest', 'RTL', 'Redux', 'API Context', 'HTML5', 'CSS', 'GIT', 'Metodologias Ágeis', 'Moodle'];
const skills = ['TDD', 'ORM', 'JWT', 'MongoDB', 'Python'];

export {
  projectsPI,
  projectsList,
  listRouteProjects,
  techs,
  skills,
}
